import styled from "styled-components";
const MainLayout = styled.div`
  display: flex;
`;
const NavWapper = styled.div`
  flex-basis: 20%;
  height: 100vh;
  & > ul {
    height: 100%;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: space-evenly;
    list-style: none;
  }
`;
const LayOut = ({ children }) => {
  return (
    <MainLayout>
      <NavWapper>
        <ul>
          <li>Logo</li>
          <li>Home</li>
          <li>About me</li>
          <li>Contact me</li>
        </ul>
      </NavWapper>
      {children}
    </MainLayout>
  );
};

export default LayOut;
